@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix : <http://www.shipping-system.com/#> .

:Platform rdf:type owl:Class .
:ShippingCost rdf:type owl:Class .
:Weight rdf:type owl:DataProperty .
:Destination rdf:type owl:Class .
:calculateShippingCost rdf:type owl:ObjectProperty ;

                    rdfs:domain :Platform ;
                    rdfs:range :ShippingCost .

:ShippingCost owl:equivalentClass [ rdf:type owl:Restriction ;
                                        owl:onProperty :calculateShippingCost ;
                                        owl:someValuesFrom [ rdf:type owl:Class ;
                                                              owl:intersectionOf ( :Weight :Destination ) ]] .

:Weight rdfs:range xsd:float .

:Destination rdfs:range xsd:string .
